import React, {useState,useEffect,useRef} from 'react';
import Card from '../../../utils/Card'
import axios from 'axios';
let link = "https://fakestoreapi.com/products"

const List = ({isOpenModal}) => {
 var loadNumber = 1;
 const [items, setItems] = useState([])
 const [element, setElement] = useState(null)
 const [sliceUpperLimit, setSliceUpperLimit]= useState(3)
 const observer = useRef(new IntersectionObserver((entries) => {
  const first = entries[0]
  console.log(first)
  if (first.isIntersecting) {
   loadNumber++
   setSliceUpperLimit(sliceUpperLimit*loadNumber)
  }
  }, { threshold: 1 }))
 
 function getItems() {
  axios.get(link)
   .then(lists => setItems(lists.data))
  .then(console.log(items))
 }
 useEffect(() => {
  const currentElement = element;
  const currentObserver = observer.current;

  if (currentElement) {
   currentObserver.observe(currentElement)
  }
  getItems()

  return () => {
   if (currentElement) {
    currentObserver.unobserve(currentElement)
   }
  }
 },[element]);

 const styles = {
  body: "px-36 pb-24",
  title: "text-xl font-semibold",
  subtitle: "text-xs font-normal"
 }
 return(
  <div className={styles.body}>
   <p className={styles.title}>Popul√¶re annonser <span className={styles.subtitle}>Hvorfor anbefaler vi disse annonsene?</span></p>
   <div className=" flex flex-wrap py-16" >
    {
     items.slice(0,sliceUpperLimit).map(item =>
      <div className="w-80 py-6" key={item.id.toString()}>
        <Card isOpenModal={isOpenModal} price={item.price} title={item.title} id={item.id} image={item.image} />
       {((item.id + 1) % 3 == 0) && <div ref={setElement}/>}
      </div>
     )
    }
    </div>
  </div>
 )
}

export default List;
